  Phi_N2 = RHO_N * Mtot * pow(0.1e1 + sqrt(Mu_N2 / Mu_N) * pow(0.2e1, 0.3e1 / 0.4e1) / 0.2e1, 0.2e1) * sqrt(0.6e1) / RHO / M_N / 0.12e2 + RHO_N2 * Mtot / RHO / M_N / 0.2e1;
